import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

// Suppress benign ResizeObserver errors that surface in Chrome/CRA overlay
// This does not hide real errors; it only filters this specific noisy browser quirk
const ignoreResizeObserverError = (event) => {
  const message = event?.message || "";
  if (
    typeof message === 'string' && (
      message.includes('ResizeObserver loop limit exceeded') ||
      message.includes('ResizeObserver loop completed with undelivered notifications')
    )
  ) {
    event.stopImmediatePropagation();
  }
};
window.addEventListener('error', ignoreResizeObserverError, true);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
